import Classes from "./loading.css";

const Loading = () => {
  return (
    <img
      className={Classes.loading}
      loading="lazy"
      src="https://acegif.com/wp-content/uploads/loading-45.gif"
      alt="loading..."
    ></img>
  );
};

export default Loading;
